import Header from './components/Header/Header';
import './App.css';
import "./fonts/BMEULJIROTTF.ttf";
import Line from "./components/Line/Line";

function App() { 
  return (
    <div className="App">
      <Header />
      <Line />
      <h1>About the Author</h1>
      <Line />
      <h1>Course Learning Outcomes</h1>
      <Line />
      <h1>Syllabus</h1>
      <Line />
    </div> 
  );
}

export default App;
